import React from 'react';
import './Header.css';
const Header = () => {
    return (
        <div className='grid1'>
            <h3>Challenge Yourself</h3>
            <div className='grid2'>
                <link to='/'>Home</link>
                <link to='/topics'>Topics</link>
                <link to='/statchart'>StatChart</link>
                <link to='/blog'>Blog</link>
                <link to='/about'>About</link>
            </div>

        </div>
    );
};

export default Header;
